    createtemplateicon: {
        border: "1px solid #0056b3",
        borderRadius:20,
        padding: 32,
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        minHeight: 300,
        "& svg": {
            fontSize: 148,
            color: "#DFDFDF",
        },
    },
    createtemplink: {
        textDecoration: "none",
        color: "#707070",
    },
    createtemplatelabel: {
        marginTop: 22,
        display: "block"
    },
    templateboxpadding: {
        padding: 13,
    }
});
